    "2016-08-18T06:28:01.541120",nt"name": "department-of-human-resourcesdhr-child-support-enforcement-administration-performance-meas",nt"isopen":
    false,nt"url": null,nt"notes": "CHILD SUPPORT ENFORCEMENT ADMINISTRATIONnnThe
    performance measures are used to evaluate each State's performance and measure results
    in the Child Support Enforcement program. These measures emphasize paternity establishment,
    support order establishment, collection of current support, collection of arrearages,
    and cost effectiveness. The performance measures, except cost effectiveness which
    can only be measured annually, are calculated from data which is reported on federal
    form OCSE 157.  nnCASES WITH SUPPORT ORDERSnThis metric measures the proportion
    of IV-D cases with support orders established.nnEquation:nNumber of IV-D Cases with
    Support Orders divided by Total Number of IV-D CasesnnIV-D Paternity Establishment
    Percentage:nThis metric measures the proportion of children in the IV-D caseload
    as of the end of the preceding FFY who were born out of wedlock is the total number
    of children in the IV-D caseload in the federal fiscal year born out of wedlock
    with paternity established or acknowledged divided by the total number of children
    in the IV-D caseload as of the end of the preceding FFY who were born out of wedlock.
     .nnEquation:nTotal # of Children in IV-D Caseload in the Federal Fiscal Year or,
    as of the end of the Fiscal Year who were born out of wedlock with Paternity Established
    or Acknowledged divided by Total # of Children in IV-D Caseload as of the end of
    the preceding Federal Fiscal Year who were Born Out of WedlocknnCOLLECTIONS ON CURRENT
    SUPPORTnThis measure focuses on the proportion of current support due that is collected
    on IV-D cases. nnEquation:nTotal Dollars Collected for Current Support in IV-D Cases
    during the Federal Fiscal Year divided by Total Dollars Owed for Current Support
    in IV-D Cases during the Federal Fiscal YearnnCOLLECTIONS ON ARREARSnThe measure
    assesses efforts to collect money from those cases with an arrearage due. nThe measure
    specifically counts paying cases, and not total arrears dollars collected.nnEquation:nTotal
    number of IV-D cases paying toward arrears during the Federal Fiscal Year divided
    by Total number of IV-D cases with arrears due",nt"license_title": "License
